import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { allFIR, deleteFIR } from "../modules/formdetails";

const BookList = () => {

  const dispatch = useDispatch();
  const { FIR } = useSelector((state) => state);

  useEffect(() => {
    dispatch(allFIR())
  }, []); // eslint-disable-line react-hooks/exhaustive-deps

  return (
    <div className="row">
      <div className="col-sm-12">
        <h1>Complaints List</h1>
        <table className="table table-striped">
          <thead>
          <tr>
            <th>ID</th>
            <th>Police Station</th>
            <th>FIRNo</th>
            <th>Date</th>
          </tr>
          </thead>
          <tbody>
          {FIR.map((forms) => (
            <tr key={forms.id}>
              <td>{forms.id}</td>
              <td>
                <Link to={`/FIR/${forms.id}`}>{forms.PoliceStation}</Link>
              </td>
              <td>{forms.policeStation}</td>
              <td>
                <button className="btn btn-xs btn-danger" onClick={() => dispatch(deleteFIR(forms))}>
                  Delete Complaint
                </button>
              </td>
            </tr>
          ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default BookList
